import React from 'react';
import { Container } from 'react-bootstrap';

const EditProfile = () => {
  return (
    <Container className="mt-5">
      <h2>Editácia profilu</h2>
      <p>Tento komponent ešte nebol implementovaný.</p>
    </Container>
  );
};

export default EditProfile;
